import '../styles/adminNavbar.css'
import { Link } from 'react-router-dom';
const AdminNavbar = () => {
    return (
      <div className="admin-navbar1">
          <div className="adminNavbar">

<div className="title">
    <h1>AdminPortal</h1>
</div>

<div className="links">
<Link to="" className='nav-links' >DashBoard</Link>
    <Link to="" className='nav-links' >Add Books</Link>
    <Link to="" className='nav-links' >Add Users</Link >
    <Link to="" className='nav-links' >Book List</Link >
    <Link to="" className='nav-links' >Users List</Link >
    <Link to="" className='nav-links' >Logout</Link >
</div>
</div>
<h1>welcome to admin page</h1>
      </div>
      

    );
}

export default AdminNavbar;
